    id: 8428348801273,
    title: "Choco Butterscotch Barks (300g) in Gift Box",
    handle: "choco-butterscotch-barks-300g-in-gift-box-1",
    body_html:
      '\u003Cmeta charset="utf-8"\u003E\n\u003Cp\u003E \u003C/p\u003E\n\u003Cp\u003E\u003Cspan\u003E\u003Cmeta charset="utf-8"\u003E \u003Cspan style="color: #2b00ff;"\u003E\u003Cstrong\u003ERemember!\u003C/strong\u003E\u003C/span\u003E\u003Cbr data-mce-fragment="1"\u003E\u003Cbr data-mce-fragment="1"\u003E\u003Cspan style="color: #2b00ff;"\u003E\u003Cstrong\u003EWe want to make sure your gift reaches in time, please select a delivery day 1-2 days ahead of your desired date for an on-time delivery as we cannot commit to specific delivery timings.\u003C/strong\u003E\u003C/span\u003E\u003C/span\u003E\u003C/p\u003E\n\u003Cp\u003E\u003Cspan\u003EA happy kitchen accident, this sharp-edged dark chocolate and butterscotch brittle is loaded with crunch and nostalgia - almonds and sea salt.\u003C/span\u003E \u003C/p\u003E\n\u003Cul\u003E\n\u003Cli\u003E\u003Cspan style="color: #ba9212;"\u003E\u003Cem data-mce-fragment="1"\u003E\u003Cstrong data-mce-fragment="1"\u003EHand-made\u003C/strong\u003E with love one by one - with only the \u003Cstrong data-mce-fragment="1"\u003Ebest ingredients\u003C/strong\u003E\u003C/em\u003E\u003C/span\u003E\u003C/li\u003E\n\u003Cli\u003E\u003Cspan style="color: #ba9212;"\u003E\u003Cem data-mce-fragment="1"\u003E\u003Cstrong data-mce-fragment="1"\u003E100% vegetarian\u003C/strong\u003E &amp; \u003Cstrong data-mce-fragment="1"\u003Epreservative free \u003C/strong\u003E\u003C/em\u003E\u003C/span\u003E\u003C/li\u003E\n\u003Cli\u003E\u003Cspan style="color: #ba9212;"\u003E\u003Cem data-mce-fragment="1"\u003ERefrigerate &amp; enjoy \u003Cstrong data-mce-fragment="1"\u003Ewithin 30 days. \u003C/strong\u003E\u003C/em\u003E\u003C/span\u003E\u003C/li\u003E\n\u003Cli\u003E\u003Cspan style="color: #ba9212;"\u003E\u003Cem data-mce-fragment="1"\u003EGluten free(contains soy, nuts &amp; lactose)\u003C/em\u003E\u003C/span\u003E\u003C/li\u003E\n\u003C/ul\u003E\n\u003Ch2\u003E\u003C/h2\u003E\n\u003C!-- split --\u003E\n\u003Ch2\u003EA little more about this Bark\u003C/h2\u003E\n\u003Cp\u003EWhen our Chief Mithaiwala was travelling through Lucknow, he tasted a local delicacy called Karak Sohan Halwa. It is a flat disc, made by cooking together wheat flour, refined flour, sugar and lots of ghee. This thickened mixture is then poured over mixed nuts in a round mould and left to set, resulting in a sweet that is almost biscuit-like!\u003C/p\u003E\n\u003Cp\u003EInspired by the brittle candy texture of this local delicacy, our Barks are made by sandwiching a generous layer of silky butterscotch caramel between dark chocolate. This is then topped with roasted almonds for crunch and then sprinkled with sea salt to balance out the sweetness. Our interpretation was to make this local delight into an on the go snack. It’s the variety of textures in our Chocolate Butterscotch Barks that keep you reaching out for more!\u003C/p\u003E\n\u003Ch2\u003EHow it\'s made\u003C/h2\u003E\n\u003Cdiv class="grid"\u003E\n\u003Cdiv class="grid__item medium-up--one-third small--one-half"\u003E\u003Cimg src="https://cdn.shopify.com/s/files/1/0301/1923/1620/files/Pouring_of_chocolate_for_barks.jpg?v=1612782558" alt=""\u003E\u003C/div\u003E\n\u003Cdiv class="grid__item medium-up--one-third small--one-half"\u003E\u003Cimg src="https://cdn.shopify.com/s/files/1/0301/1923/1620/files/WhatsApp_Image_2021-02-05_at_5.3.jpg?v=1612783096" alt=""\u003E\u003C/div\u003E\n\u003Cdiv class="grid__item medium-up--one-third small--one-half"\u003E\u003Cimg src="https://cdn.shopify.com/s/files/1/0301/1923/1620/files/Almonds_and_seasalt.jpg?v=1612782558" alt=""\u003E\u003C/div\u003E\n\u003C/div\u003E',
